) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: job_candidates
#

DROP TABLE IF EXISTS `job_candidates`;

CREATE TABLE `job_candidates` (
