  `resume` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: job_categories
#

DROP TABLE IF EXISTS `job_categories`;

CREATE TABLE `job_categories` (
